import React from "react";
import ReactDOM from "react-dom";
import App from "./app";

import {TourRoot} from "react-rtg";
import { Toaster } from 'react-hot-toast';
import { BrowserRouter as Router } from "react-router-dom";

import Auth0ProviderWithHistory from "./auth/auth0-provider-with-history";

import "./scss/index.scss";
import "./translations/i18n";

ReactDOM.render(

  <Router>
    <Auth0ProviderWithHistory>

      <TourRoot>
        <Toaster 
          position="top-right" 
          toastOptions={{
            className: '',
            duration: 4000,
            style: {
              border: '1px solid #222b2a',
              background: '#f4f4f4',
              color: '#222b2a',
              padding: '15px',
            },

            success: {
              duration: 4000,
              style: {
                border: '1px solid #d6e9c6',
                padding: '15px',
                color: '#3c763d',
                background: "#dff0d8"
              },
              iconTheme: {
                primary: '#3c763d',
                secondary: '#d6e9c6',
              }
            },

            error: {
              duration: 4000,
              style: {
                border: '1px solid #ebccd1',
                padding: '15px',
                color: '#a94442',
                background: "#f2dede"
              },
              iconTheme: {
                primary: '#a94442',
                secondary: '#ebccd1',
              }
            },
          }}
        />

        <App />
      </TourRoot>
    </Auth0ProviderWithHistory>
  </Router>,

  document.getElementById("root")
);
